import React from 'react'
import UserForm from './UserForm'

export default function UserPage() {
    return (
        <div>
            <h4>
                Com a Calorie Police, nós o ajudaremos a calcular as calorias diárias de que você necessita. Nossa calculadora é bastante personalizada, assim indica valores apropriados de calorias diárias para mulheres e homens, e até mesmo a necessidade de calorias diárias infantil. Basta você inserir os dados necessários e a calculadora lhe apresentará a faixa saudável de ingestão calórica para o seu dia, seja o seu objetivo perder, ganhar ou manter seu peso. Experimente agora mesmo e facilmente contribua para sua saúde e bem estar!
            </h4>

            <UserForm />
        </div>
    )
}
